INSERT INTO `inttutorial` VALUES (1,'data/interface/interactivetutorial/ars.gif',1,0,1,'[font=arial]Guten Tag!\r\n\r\nWenn ich mich kurz vorstellen darf - Mein Name ist Konteradmiral Korrow und ich bin f&uuml;r die Betreuung neuer Siedler in den so genannten Lost Lands zust&auml;ndig. Also auch f&uuml;r Sie.\r\nIch unterstehe dem GCP Kolonialamt, das die Kolonisation der Asteroiden in diesen Systemen f&ouml;rdert. Sollten sie sp&auml;ter weitere Fragen haben, schicken Sie diese bitte an die ID -16. Die Fragen werden dann automatisch an mich weitergeleitet.[/font]',NULL),(2,'data/interface/interactivetutorial/ars.gif',1,0,1,'[font=arial]Gut, Sie haben sich jetzt einen individuellen Namen gegeben. Weitere wichtige Punkte sind:\r\nDie Zeit in Drifting-Souls l&auml;uft in Ticks. Zwischen den Ticks k&ouml;nnen Sie frei agieren, bis Ihnen die Energie ausgeht oder die Antriebe vergl&uuml;hen. W&auml;hrend der Ticks sollten Sie keine Handlungen vornehmen, auch wenn dies m&ouml;glich ist, denn dann wird die Energieerzeugung der Schiffe, Produktion der Anlagen und Abk&uuml;hlung der Triebwerke berechnet. Die Ticks beginnen jeweils um 0, 4, 12, 16, 18, 20 und 22 Uhr MEZ bzw MESZ und dauern ca 15 Minuten - je drei Ticks sind ein Ingame-Tag.\r\nWenn Sie nun die Basenansicht aufrufen, werden Sie Ihren ersten besiedelten Asteroiden sehen k&ouml;nnen. Er verf&uuml;gt bereits &uuml;ber einige Geb&auml;ude und in seinen Lagerr&auml;umen sind auch Ressourcen verschiedener Art gelagert. \r\nWenn Sie den Namen oder die ID anklicken kommen Sie zur Asteroiden-Detail-Ansicht - wenn Sie den Mauszeiger &uuml;ber den Geb&auml;uden verweilen lassen, wird deren Bezeichnung eingeblendet. In DS wird von diesen Tooltipps h&auml;ufig Gebrauch gemacht und Sie k&ouml;nnen oft zus&auml;tzliche Kurz-Informationen dadurch erhalten. Sehen Sie sich Ihren Asteroiden nun ruhig an, kehren Sie dann hierher zur&uuml;ck und schalten Sie weiter.[/font]',NULL),(3,'data/interface/interactivetutorial/ars.gif',1,0,1,'[font=arial]Es empfiehlt sich den Tanker im Nebel stehen zu lassen und das Deuterium [img]http://ds2.drifting-souls.net/current/data/resources/Deuterium.gif[/img] jeweils mit dem Frachter abzuholen.\r\nNoch ein Wort zur Versorgung der Schiffe: Alle Produktion von Nahrung fliesst in den sogenannten Pool, aus dem im Tick Nahrung f&uuml;r Bev&ouml;lkerung auf den Asteroiden und Besatzungen auf den Schiffen entnommen wird, solange Ihre Produktion im positiven Bereich bleibt - zu sehen in der &Uuml;bersicht nach dem Nahrungssymbol [img]http://ds2.drifting-souls.net/current/data/resources/Nahrung.gif[/img] - wird nichts passieren. Sollten Sie aber zu viele Schiffe haben, kann es sein, dass sich der Pool leert - in diesem Falle werden Besatzungen auf den Schiffen verhungern und k&ouml;nnen von anderen Siedlern oder Piraten gekapert werden. Der Pool kann mit gekaufter Nahrung beladen werden, in dem Sie sie auf dem Asteroiden abladen und mit Hilfe des gr&uuml;nen Pfeils hinter Nahrung in der Asteroiden-Detail-Ansicht die Menge angeben, die sie in den Pool laden wollen (Angabe einer negativen Zahl entl&auml;dt den Pool)\r\n\r\nSoweit meine kleine Einf&uuml;hrung.\r\n\r\nDenken Sie daran, Sie k&ouml;nnen mich auch jeder Zeit via PM an ID -16 weitere Dinge fragen.\r\nEs lohnt sich &uuml;brigens auch, mal im IRC (irc.euirc.net - #ds und #ds-help) vorbei zu schauen. Dort finden sich garantiert Siedler, die Ihnen umsonst oder zu einem geringen Preis einige Rohstoffe &uuml;berlassen oder wertvolle Tipps geben k&ouml;nnen. Ein Java-Chat-Client befindet sich auf der Startseite ( oder hier: [url=http://ds.drifting-souls.net/index.php?action=javachat]Java-Chat[/url] )\r\n\r\nDer komplette Text dieser Einf&uuml;hrung ist auch in der Wiki zu finden [url=http://wiki.drifting-souls.net/Das_Ingame-Tutorial]Tutorial[/url]\r\n\r\nM&ouml;gen Sie viel Erfolg in den Lost Lands haben![/font]',NULL);
/*!40000 ALTER TABLE `inttutorial` ENABLE KEYS */;
UNLOCK TABLES;

