,NULL,0,0,'data/resources/Soldaten.gif','Böser Admin','data/resources/Soldaten.gif','common',0),(41,0,1,'Ein ganzer Container dieses berühmten Erfrischungsgetränkes',NULL,0,0,'data/items/module/vasucola_large.png','Vasu-Cola','data/items/module/vasucola.png','common',0),(42,0,1,'Ein ganzer Container dieses berühmten Erfrischungsgetränkes',NULL,0,0,'data/items/module/bier_large.png','Centauri Bier','data/items/module/bier.png','common',0),(43,0,10,'Ein lebendes Wazefag. Der Name dieses denebolanischen Tieres geht auf den Ausruf bei seiner ersten Sichtung auf Deneb II zurück. Wazefags sind sehr angriffslustig geben aber prima Steaks ... Der Transport der Tiere ohne entsprende Vorsichtsmaßnahmen ist nicht zu empfehlen!',NULL,0,0,'data/items/module/wazefag_large.png','Wazefag','data/items/module/wazefag.png','common',0),(44,0,5,'Ein lebendes Ganelho. Auch sie sind für ihre kulinarische Verwertbarkeit sehr geschätzt. Da sie sich in Gefangenschaft kaum vermehren sind sie allerdings auch sehr teuer. Keine klassische Festtafel ohne zarte Ganelho-Filets. Einmal der Gefangenschaft entronnen, lassen sie sich selten wieder einfangen.',NULL,0,0,'data/items/module/echse_large.png','Ganelho','data/items/module/echse.png','common',0),(45,0,2,'Ein Kühlcontainer mit einer merkwürdigen vasudanischen Spezialität.',NULL,0,0,'data/items/module/headz_large.png','Headz','data/items/module/headz.png','common',0),(46,0,2,'Ein Kühlcontainer mit einer merkwürdigen terranischen Spezialität.',NULL,0,0,'data/items/module/dose_large.png','Delikatessenkonserve','data/items/module/dose.png','common',0),(47,0,2,'Ein Kühlcontainer mit einer Ladung Nervenstimulantien. Sie sind für den Gebrauch in der Raumfahrt nicht zugelassen, werden aber dennoch in großen Mengen auf Stationen vor allem in Krisengebieten gehandelt.',NULL,0,0,'data/items/module/neurostim_large.png','NeuroStim','data/items/module/neurostim.png','common',0),(48,0,2,'Ein Kühlcontainer mit dem Medikament Paranex. Es ist eines der wenigen M