INSERT INTO `ship_types` VALUES (1,0,200000,0.00,60000,0,8,7500,'Die Orion V2 baut auf dem Rumpf der Orion-Zerstörer aus dem ersten Shivaner-Krieg auf. Trotz der hohen Verluste dieser Zerstörer an shivanische Demon-Zerstörer und die Lucifer hielten diese Schiffe die Standarte der GTA hoch. Mit Beginn der Kooperation mit den Vasudanern wurden die verbleibenden Orion-Zerstörer aufgerüstet und auf den neusten Stand der Technik gebracht.\r\nViele dieser Zerstörer fielen der NTF während ihrer Rebellion in die Hände, ebenso wie die Werften, die diese Schiffe bauen konnten. Obwohl die meisten der damals zur NTF übergelaufenen Zerstörer vernichtet wurden, findet sich immer noch eine unbekannte Anzahl dieser Schiffe in den Arsenalen der wiedererstarkenden Neo Terranischen Front.',0,2000,'secondrow versorger',10,4,0,200000,0,60,0.75,'BGreen=30|TerSlash=30|Terran_Huge_Turret=80|Terran_Turret=30|AAAf=30',10,6750,'1:misc;2:misc;3:orion_terran_destroyer_offensive;4:orion_terran_destroyer_deffensive;5:orion_terran_destroyer_engine;6:orion_terran_destroyer_reactor;7:orion_terran_destroyer_tech;8:orion_terran_destroyer_hull;9:orion_terran_destroyer_special;10:armour;11:armour;12:armour;13:armour;14:armour;15:armour;16:armour;17:armour;18:armour;19:armour;20:armour;21:armour',200000,'GTD Orion',18,2,'data/dynamicContent/a6e42e96-2f67-4728-b100-96f891512ea0.png',0,27,50,450,0,1,5,0,2,13,1,0,1000,46,1,'BGreen=3|TerSlash=3|Terran_Huge_Turret=8|Terran_Turret=3|AAAf=3',0,NULL),(2,0,0,0.00,4800,0,1,30,'Der Standardtanker der Terraner, wendiger als sein vasudanisches Pendant - dafür aber mit einem kleineren Reaktor und weniger Laderaum ausgestattet',3,40,'',10,2,0,10000,0,0,0.75,'',2,18,'1:misctanker',294,'Zephyrus',1,2,'data/dynamicContent/3c5776a0-642b-47b8-a116-f2921cd489cf.png',0,5,1,10,1,1,1,0,3,6,1,0,0,10,0,'',0,NULL),(3,0,270000,0.00,70000,0,8,9375,'2360 wurde der erste Hatshepsutzerstörer in Betrieb genommen. Akheton entwickelte diese neue Klasse von Zerstörern, die nach und nach die alten Typhoons ersetzen sollen insbesondere im Hinblick auf Kompatibilität mit modernen Strahlgeschützen,  da bei der Typhoonklasse deutlich wurde, dass die älteren Reaktoren nicht in der Lage waren mit diesen umzugehen, was zu Fehlfunktionen und Reaktorüberlastungen führte. Obgleich eine Nachrüstung teilweise gelang wurde doch deutlich, daß eine völlige Neuentwicklung unumgänglich sein würde. Die Hatshepsut ist die logische Folge dieser Erkenntnisse und ein furchterregender Anblick auf dem Schlachtfeld.\r\n',0,1500,'secondrow versorger',10,4,0,270000,0,100,0.75,'BVas=45|SVas=15|Terran_Huge_Turret=90|standard_flak=110|AAAf=60|raketen=50',10,5625,'1:misc;2:misc;3:misc;4:hatshepsut_vasudan_destroyer_offensive;5:hatshepsut_vasudan_destroyer_deffensive;6:hatshepsut_vasudan_destroyer_engine;7:hatshepsut_vasudan_destroyer_reactor;8:hatshepsut_vasudan_destroyer_tech;9:hatshepsut_vasudan_destroyer_hull;10:hatshepsut_vasudan_destroyer_special;11:armour;12:armour;13:armour;14:armour;15:armour;16:armour;17:armour;18:armour;19:armour;20:armour;21:armour;22:armour;23:armour;24:armour;25:armour',200000,'GVD Hatshepsut',18,2,'data/dynamicContent/29df33f6-142f-4fcd-8528-d5b4b2a7afab.png',90,0,60,750,0,1,5,0,2,13,1,0,1000,17,1,'BVas=3|SVas=1|Terran_Huge_Turret=6|standard_flak=11|AAAf=4|raketen=5',0,NULL),(5,0,40000,0.00,10000,0,3,1400,'Deimoskorvetten sind massiv gepanzert und bewaffnet und vielseitig nutzbar. Ursprünglich als Ersatz für die veralteten Kreuzer der terranischen Flottenverbände gedacht, werden sie momentan jedoch als Ergänzung genutzt, da sich herausstellte, dass ihre Effektivität in der Jägerabwehr deutlich hinter der von Kreuzern zurückbleibt. Nichtsdestotrotz bilden diese Schiffe jedoch einen unschätzbaren Wert, wenn es um das Ausschalten von feindlichen Großkampfschiffen geht. Modernste Strahlengeschütze stellen die Primärwaffen und sind in der Lage problemlos Kreuzer und auch andere Korvetten zu zerstören - etwas das vormals praktisch nur Zerstörern und Bombern vorbehalten war.',0,500,'',10,5,0,40000,0,0,0.75,'TerSlash=40|Terran_Huge_Turret=40|Terran_Turret=30|standard_flak=15|AAAf=10',10,1100,'1:misc;2:misc;3:terran_corvette_upgrade;4:armour;5:armour;6:armour;7:armour;8:armour;9:armour;10:armour;11:armour;12:armour;13:armour',15680,'GTCv Deimos',8,2,'data/dynamicContent/5ccdeea7-241f-4aad-a7f4-56979a723f83.png',0,10,8,165,6,1,4,0,5,8,1,0,200,14,0,'TerSlash=4|Terran_Huge_Turret=4|Terran_Turret=6|standard_flak=3|AAAf=2',0,NULL),(6,0,35000,0.00,7200,0,2,600,'Die Mentu soll den in die Jahre gekommenen Kreuzer Aten schritt für Schritt ersetzen\r\nWie die Typhoon war auch die Aten nur bedingt für die neuen Strahlengeschütze geeignet, und statt die Reaktoren und Antriebe von hunderten Aten-Kreuzern auszuwechseln, wie es bei der Typhoon gemacht wurde, entschloss man sich einen neuen Schiffstyp zu entwickeln, die Mentu.\r\n',0,220,'',10,4,0,35000,0,0,0.75,'VSlash=5|Terran_Huge_Turret=10|Terran_Turret=30|standard_flak=15|AAAf=15|raketen=15',5,500,'1:misc;2:misc;3:vasudan_hcruiser_upgrade;4:armour;5:armour;6:armour',6860,'GVC Mentu',8,2,'data/dynamicContent/40220d9d-8c28-4125-8023-4c40f22473d4.png',13,0,3,110,0,1,3,0,7,6,1,5,100,14,0,'VSlash=1|Terran_Huge_Turret=2|Terran_Turret=6|standard_flak=3|AAAf=3|raketen=3',0,NULL),(7,0,200000,0.00,65000,0,8,9000,'Die Typhoon war das gefährlichste Schiff, welches im ersten Shivaner-Krieg aufgeboten werden konnte, und ein Stolz für die Vasudaner. Umso enttäuschter waren sie, als sich herausstellte, dass die Reaktoren und Antriebe der Typhoon keine der neuentwickelten Strahlengeschütze unterstützen konnten.\r\nZwar wurde bei einer Reihe von Typhoons neue und geeignete Reaktor-Antriebs Kombinationen eingebaut und an der Bewaffnung die entsprechenden Modifikationen vorgenommen, jedoch wurde die Typhoon inzwischen durch die Hatshepsut weitestgehend abgelöst. \r\n',0,1100,'secondrow versorger',10,4,0,240000,0,80,0.75,'BVas=30|Terran_Huge_Turret=20|standard_flak=50|AAAf=20|raketen=40',10,8250,'1:misc;2:typhoon_vasudan_destroyer_offensive;3:typhoon_vasudan_destroyer_deffensive;4:typhoon_vasudan_destroyer_engine;5:typhoon_vasudan_destroyer_reactor;6:typhoon_vasudan_destroyer_tech;7:typhoon_vasudan_destroyer_hull;8:typhoon_vasudan_destroyer_special;9:misc;10:armour;11:armour;12:armour;13:armour;14:armour;15:armour;16:armour;17:armour;18:armour;19:armour;20:armour;21:armour',200000,'GVD Typhon',18,2,'data/dynamicContent/8b24e490-d170-4700-9d2a-eb8e3f0c117a.png',0,21,50,370,14,1,5,0,2,13,1,0,1000,19,1,'BVas=2|Terran_Huge_Turret=2|standard_flak=5|AAAf=2|raketen=4',0,NULL),(8,0,27000,0.00,5000,0,3,350,'Die Leviathan ist eine Abwandlung der Fenris. Sie sollte die Fenris-Kreuzer von Defensivaktionen ablösen, damit diese in Vormärschen eingesetzt werden konnten. Zudem verfügt die Leviathan über eine deutlich widerstandsfähigere Hülle was sie für diese Aufgabe auch wie geschaffen machte.\r\nDie neue Leviathan ist ebenfalls mit einer Strahlenkanone nachgerüstet worden. Die Terraner mögen eben alte Designs.\r\n',0,160,'',10,4,0,27000,0,0,0.75,'SGreen=5|Terran_Turret=15|AAAf=48|doubleraketen=5',5,300,'1:misc;2:misc;3:terran_cruiser_upgrade;4:armour;5:armour;6:armour',4410,'GTC Leviathan',8,2,'data/dynamicContent/d3099616-8cef-4273-ade3-615e318a524b.png',0,6,5,55,3,1,3,0,7,6,1,15,100,14,0,'SGreen=1|Terran_Turret=3|AAAf=4|doubleraketen=1',0,NULL),(9,0,0,0.00,7500,0,2,30,'Der Triton Dynamics FR72-Transporter konnte sich nie wirklich durchsetzen. Für den militärischen Gebrauch zu schlecht geschützt, für den zivilen Gebrauch zu klein.\r\nNach der Freigabe der Pläne und dem damit verbundenen Eingeständnis des Scheiterns, gelang es einigen Bastlern den FR72 mit einigen veralteten Schildgeneratoren aus dem großen Krieg auszurüsten und die überlebensfähigkeit so beträchtlich zu erhöhen. Dadurch wurde der Einsatz in Krisengebieten möglich, wo der FR72 M nun ein häufiger Anblick ist. ',0,100,'',10,2,0,8000,0,0,0.75,'',2,18,'1:misc;2:misc',392,'Triton FR72 M',3,2,'data/dynamicContent/9104e96c-b03d-4491-9625-2597d68dca37.png',10,7,2,40,0,1,1,2000,1,6,1,0,10,7,0,'',0,NULL),(10,0,100000,0.00,500000,0,0,15000,'Die Arcadia ist einer der größten Außenposten der Terraner. Diese Festung dient dazu, Systeme vor feindlicher Invasion zu schützen, und mit ihren zahlreichen Geschützen kann sie die Gegner in Schach halten, bis Hilfe eintrifft.\r\n',0,4700,'zerstoererpanzerung srs_awac srs_ext_awac secondrow werftkomplex versorger',10,0,0,100000,0,50,0.75,'BGreen=60|TerSlash=180|Terran_Huge_Turret=20|Terran_Turret=300|AAAf=160|standard_flak_ld=120|heavy_flak_ld=120',10,9000,'1:misc;2:misc:3:misc;4:misc;5:misc_large_weapon;6:misc_large_weapon;7:misc_large_weapon;8:misc_large_weapon;9:misc_large_weapon;10:misc_large_weapon;11:misc_large_weapon;12:misc_large_weapon;13:misc_large;14:misc_large;15:misc_large;16:misc_large;17:armour;18:armour;19:armour;20:armour;21:armour;22:armour;23:armour;24:armour;25:armour;26:armour;27:armour;28:armour;29:armour;30:armour;31:armour',1000000,'GTI Arcadia',20,2,'data/dynamicContent/7cd15746-3522-4602-9005-f620c084b48b.png',0,93,100,1565,62,1,10,0,8,40,1,0,2500,16,1,'BGreen=4|TerSlash=9|Terran_Huge_Turret=10|Terran_Turret=15|AAAf=8|standard_flak_ld=6|heavy_flak_ld=6',7,NULL),(12,0,15000,0.00,3000,0,3,200,'Die Aten ist der kleinste Kreuzer des GCP, mit einer vergleichsweise geringen Bewaffnung. Hierin ähnelt sie der Fenris, weist jedoch fast das doppelte an Hüllenstärke auf. Als Relikt aus dem Großen Krieg wird sie allgemein als veraltet angesehen, obgleich es einige Bemühungen gab, zumindest den Einsatz von AAAf-Strahlern zu ermöglichen. Meist wird sie als Konvoieskorte eingesetzt, nur selten wird man sie an der Front antreffen.',0,100,'',10,4,0,18000,0,0,0.75,'Subach_HL-7=20|Terran_Turret=10|AAAf=10|raketen=16',5,175,'1:misc;2:misc;3:vasudan_cruiser_upgrade;4:armour;5:armour',2450,'GVC Aten',2,2,'data/dynamicContent/48735546-898b-47c3-8e4f-162188701465.png',0,4,3,35,2,1,3,0,6,6,1,30,50,14,0,'Subach_HL-7=4|Terran_Turret=2|AAAf=2|raketen=2',0,NULL),(13,0,0,0.00,500,0,0,0,'Obgleich das Konzept der unbemannten Geschützplattform deutliche Schwächen aufweist und Plattformen wie der Watchdog oder Ceberus de facto nicht mehr im Einsatz sind, wurde beschloßen die verbliebenen Exemplare noch einmal aufzurüsten - das Ergebnis ist der Guardian.\r\n\r\n',0,50,'',5,0,0,150,0,0,0.75,'Subach_HL-7=10',1,0,'1:jprimary:Subach_HL-7;2:jprimary:Subach_HL-7',0,'GTSG Guardian',3,2,'data/dynamicContent/e17f8cd6-e382-4449-8928-94166f0b46a5.png',0,5,1,15,0,1,0,0,10,1,1,0,0,5,0,'Subach_HL-7=2',0,NULL),(14,0,0,0.00,1200,0,0,5,'Die Mjolnir setzt statt Lasern ein einziges Strahlengeschütz ein. Die höhere Durchschlagskraft wird jedoch durch die benötigte Besatzung ausgeglichen, so dass man eine Mjolnir nicht einfach so irgendwo hinstellen und dann vergessen sollte.\r\n',0,230,'secondrow',5,0,0,2500,0,0,0.75,'mjolnir=5',1,5,'1:misc',250,'GTSG Mjolnir',10,2,'data/dynamicContent/3cb6e205-92c8-4e8c-ba9d-c28448690895.png',40,2,3,80,1,1,0,0,10,1,1,0,0,8,0,'mjolnir=1',0,NULL),(20,0,15000,0.00,6000,0,3,350,'Die von Triton Dynamics entwickelte Raider ist ein Kaperschiff.\r\nZahlreiche Disruptoren legen Antriebe und Waffen des Opfers außer Gefecht.\r\nAnschließend wird das Opfer geentert und die Waren auf den Raider transferiert, welcher diese dann seinem Besitzer abliefert.\r\n',0,280,'abfangen',10,2,0,15000,0,0,0.75,'GTW_Akheton_SDG=30|raketen=10',5,280,'1:misc;2:misc;3:boarding_cruiser_upgrade;4:armour;5:armour;6:armour',8330,'Triton CV 34 Raider',4,2,'data/dynamicContent/2f85d5d4-0937-428b-9ca3-66e5d3cdfce5.png',0,5,3,75,0,1,4,0,6,6,1,0,500,14,0,'GTW_Akheton_SDG=6|raketen=2',0,NULL),(22,0,0,0.00,20000,0,4,500,'Die GTCol Hephaistos ist eine abgespeckte Variante der Tantalos.\r\nDies war nötig geworden, da die Tantalos ein Reaktor-Antriebs-System aufweißt, welches noch sehr aufwendig zu produzieren ist. Um die dadurch entstehenden Versorgungsengpässe beim Bau zu verhindern konstruierte das GCP die Hephaistos.',0,160,'colonizer',10,4,0,9000,0,0,0.75,'',1,300,'1:misc',4900,'GTCol Hephaistos',1,2,'data/dynamicContent/27e02048-3f37-4190-a236-2a147ee562fd.png',0,0,0,60,10,1,2,0,1,8,1,0,0,4,0,'',0,NULL),(23,0,0,0.00,600,0,4,1,'Die Seth ist eines der ältesten noch eingesetzten Jägermodelle.\r\nWährend die Terraner immer neue Jäger entwickelten, bauten die Vasudaner auf alte Tugenden und entwickelten den schweren Seth-Jäger weiter.\r\nDa die Seth besser bewaffnet als eine Loki ist, geht die Seth meist als Sieger aus solchen Kämpfen hervor.\r\n',0,45,'jaeger abfangen',10,8,0,280,0,0,0.75,'Mekhu_HL-7=6|raketen=8',1,1,'1:jprimary:Mekhu_HL-7;2:jprimary:Mekhu_HL-7',210,'GVF Seth',0,2,'data/dynamicContent/ffa38012-87d5-43b5-9de2-c74db2679ada.png',0,5,2,10,2,1,0,280,9,1,1,8,0,14,0,'Mekhu_HL-7=2|raketen=2',0,NULL),(24,0,0,0.00,35000,0,2,500,'Die GTCol Tantalos stellt eine radikale Neuentwicklung durch Triton Dynamics dar. Dies war nötig geworden, nachdem der alte Colonizer der Marke Subach sich als unbrauchbar bei längeren Flügen herausgestellt hatte, wie sie nach dem Verlust von Capella notwendig wurden um den Millionen Flüchtlingen eine neue Heimat zu bieten. Im Moment kännen die GCP und Triton Dynamics jedoch nicht die enorme Nachfrage decken, da einige Modifikationen an den Werften notwendig sind um den Antrieb und den Reaktor dieses Schiffes produzieren zu können. Daher erhält jeder neue Kolonist nur einen einzigsten Colonizer der Tantalos-Reihe. \r\n',0,160,'kein_transfer colonizer',10,2,0,9000,0,0,0.75,'',1,300,'',4900,'GTCol Tantalos',1,2,'data/dynamicContent/33931f1f-565d-45ec-8149-d39549c16e26.png',0,0,0,40,20,1,1,0,1,8,1,0,0,2,0,'',0,NULL),(27,4,0,0.00,12000,0,2,50,'Der Standardfrachter des GCP. Obgleich früher nicht in der Lage Standardcontainer zu transportieren, wurde er in den letzten Jahren modifiziert um das andocken von bis zu vier Containern, Sentrieguns oder Jägern zu ermöglichen. Dies ändert jedoch nichts an seiner Schutzlosigkeit, die aus einer schwachen Hülle und praktisch nicht existenten Bewaffnung resultiert.\r\n\r\nJedes angedockte Objekt erhöht die Flugkosten des Schiffes um 1.',0,120,'',10,5,0,5000,0,0,0.75,'Subach_HL-7=5|standard_flak=5',5,30,'1:misc',490,'GTT Triton',3,2,'data/dynamicContent/af214908-54ff-44d4-927e-b05bdf915e51.png',0,8,2,72,4,1,1,0,1,6,1,0,0,9,0,'Subach_HL-7=1|standard_flak=1',0,NULL),(28,0,0,0.00,8000,0,0,0,'Seit die Terraner den Weltraum bereisen, wissen sie, wie praktisch es ist, Waren in Containern verpackt in speziellen \"Versorgungsdepots\" zu sammeln.\r\nContainer haben den Vorteil, den Frachtraum eines Frachters der Triton, Poseidon oder Isis-Klasse zu erhöhen.\r\n',0,100,'',10,0,0,300,0,0,0.75,'',1,0,'',0,'TC 2',0,2,'data/dynamicContent/ccb56087-a2ae-47bf-bcdb-2466ed318038.png',0,0,0,0,0,1,0,0,12,1,1,0,0,5,0,'',0,NULL),(29,0,0,0.00,8000,0,0,0,'Auch die Vasudaner wissen, dass Frachtcontainer sehr praktisch sind.\r\nVasudanische Frachtcontainer haben keine Nachteile vor ihren terranischen Entsprechungen.\r\n',0,100,'',10,0,0,300,0,0,0.75,'',1,0,'',0,'VC 3',0,2,'data/dynamicContent/90dbd325-656a-4907-a161-f765cd65c2fc.png',0,0,0,0,0,1,0,0,12,1,1,0,0,4,0,'',0,NULL),(30,0,0,0.00,5800,0,2,30,'Deuterium, das Rohmaterial für Plastik und der Brennstoff für Fusionsreaktoren aller Art, kommt nicht auf Asteroiden vor.\r\nDie Anuket, der vasudanische Tanker, ist etwas behäbiger als das terranische Gegenstück, hat jedoch mehr Frachtraum.\r\n',3,50,'',10,2,0,4000,0,0,0.75,'',2,18,'1:misctanker',294,'Anuket',1,2,'data/dynamicContent/cb3cf0d5-a600-477f-89f3-ffaa22f5adae.png',0,6,1,12,0,1,1,0,3,6,1,0,0,7,0,'',0,NULL),(31,2,0,0.00,12000,0,2,30,'Die Ma\'at war während des Großen Krieges der Standard-Transporter der jetztigen Vasudaner. Seine 4 Laserkanonen konnten frechen einzelgängerischen GTA-Jäger abwehren, jedoch waren die Ma\'at gegen eine Vierer-Staffel machtlos.\r\nAuch heute setzen die Vasudaner die Ma\'at als billiges bewaffnetes Transportschiff ein.\r\n\r\nJedes angedockte Objekt erhöht die Flugkosten des Schiffes um 1.',0,120,'',10,4,0,8500,0,0,0.75,'Subach_HL-7=5|Terran_Turret=15',5,18,'1:misc',294,'PVFr Ma\'at',4,2,'data/dynamicContent/84f1f8f4-f7c8-4cee-be55-44bc468fd8c8.png',0,0,2,48,8,1,1,0,1,6,1,0,0,9,0,'Subach_HL-7=1|Terran_Turret=3',0,NULL),(33,0,0,0.00,150000,0,0,2000,'Die Ganymede ist die Standardwerftanlage des GCP. Sie ist weit verbreitet und in der Lage jedwedes Schiff, vom Jäger bis zum Zerstörer zu bauen und zu reparieren. Eine starke Hülle schützt die ansonsten unbewaffnete Installation, die unbedingt geschützt werden sollte.\r\n',0,1200,'zerstoererpanzerung secondrow werftkomplex',10,0,0,90000,0,0,0.75,'',1,1200,'1:misc;2:misc;3:misc_ganystation;4:misc_ganystation;5:weapon_ganystation;6:weapon_ganystation;7:armour;8:armour;9:armour;10:armour;11:armour;12:armour;13:armour',29400,'GTI Ganymede',14,2,'data/dynamicContent/a0fd3d65-338b-449b-ba5b-237012614b19.png',20,5,30,80,0,1,1,0,8,9,1,0,1000,14,0,'',7,NULL),(34,0,35000,0.00,10000,0,4,1100,'Die Sobek ist das Pendant zur terranischen Deimos. Von dieser unterscheidet sie sich vor allem in ihrer Energieversorgung - die neuen Antimaterie-Reaktoren von Mekhu Enterprises setzen neue Standards. Die Sobek stellt eine Gefahr für jegliches feindliche Schiff dar.\r\n',0,490,'',10,5,0,40000,0,0,0.75,'VSlash=24|Terran_Huge_Turret=30|Terran_Turret=40|standard_flak=15|AAAf=10',10,900,'1:misc;2:misc;3:vasudan_corvette_upgrade;4:armour;5:armour;6:armour;7:armour;8:armour;9:armour;10:armour;11:armour;12:armour;13:armour',12740,'GVCv Sobek',9,2,'data/dynamicContent/4071883b-54f1-4a78-8ca0-1edeba0d020b.png',29,0,9,245,0,1,4,0,5,8,1,0,200,19,0,'VSlash=2|Terran_Huge_Turret=3|Terran_Turret=8|standard_flak=3|AAAf=2',0,NULL),(35,3,0,0.00,82000,0,2,250,'Das Flottenversorgungsschiff Pyros ist eine Neuentwicklung, die Elemente der Tritonfrachter, der Nautilusgroßraumtransporter und der Modularen Kompaktwerftanlagen vereint. Ein großer Frachtraum, 3 externe Dockinganlagen für Container und Sperrgeschütze sowie 2 Jägerhangars sowie die Fähigkeit