rieben das Handling des Ares mit den passenden Worten: \"Er fliegt sich wie eine Kartoffel.\"\r\nDennoch ist dieser Jäger der neuesten Generation seine immensen Produktionskosten durchaus wert, überwiegen die Vorteile doch bei weitem. Der erfolgreiche Einsatz des Ares beim SOK hat dies bestätigt.',0,120,'jaeger abfangen',10,10,0,525,0,0,0.75,'Kayser=24|raketen=12',1,1,'1:jprimary:Kayser;2:jprimary:Kayser;3:jprimary:Kayser;4:jprimary:Kayser;5:jprimary:Kayser;6:jprimary:Kayser',210,'GTF Ares',3,2,'data/dynamicContent/4cfb7e55-7b73-4fce-93fc-49cc83e4a361.png',20,10,2,70,0,1,0,650,9,2,1,6,0,15,0,'Kayser=6|raketen=2',0,NULL),(44,0,0,0.00,3000,0,2,400,'Die GTA Charybdis ist mit modernsten Tachyon-AWACS-Sensoren ausgestattet, die eine Langstreckenaufklärung ohnegleichen ermöglichen. Charybdis sind jedoch nur schlecht gepanzert und bis auf zwei Flakgeschütze unbewaffnet, so dass sie nie unbewacht fliegen sollten. Auch eine Aufklärung von Nebeln erwies sich als unmöglich, wie schon die Untersuchung im Nebel hinter dem Knoßosportal bewies.',0,120,'srs_awac secondrow',10,3,0,10000,0,0,0.5,'standard_flak=10',5,240,'1:misc;2:miscawacs;3:armour;4:armour',4410,'GTA Charybdis',2,2,'data/dynamicContent/de5e3058-c4f7-4888-a7d5-30c94e6b3246.png',0,9,5,75,3,1,10,0,13,7,1,0,50,12,0,'standard_flak=2',0,NULL),(48,0,0,0.00,2800,0,2,320,'Das vasudanische äquivalent der Charybdis ist ebenfalls mit zwei Flakgeschützen bewaffnet, schneller und wendiger, jedoch schlechter gepanzert und mit einem Reaktor ausgestattet, der auf moderner Antimaterietechnik beruht, dessen Gesamtoutput jedoch um 33% geringer ist.',0,100,'srs_awac secondrow',10,2,0,8000,0,0,0.5,'standard_flak=10',5,192,'1:misc;2:miscawacs;3:armour;4:armour',3626,'GVA Setekh',2,2,'data/dynamicContent/b680c097-d6f8-45b0-a371-2367649f383d.png',18,0,6,50,0,1,10,0,13,7,1,0,50,12,0,'standard_flak=2',0,NULL),(49,0,0,0.00,1320,0,0,0,'Hinterlassenschaft wilder Partys mit Waffeneinsatz, die anschlieÃŸend den Flugverkehr gefÃ¤hrden.\r\nWer in diesen TrÃ¼mmern grÃ¼ndlich sucht, findet vielleicht noch was wertvolles.\r\nAnsonsten sind die Teile ein Fall fÃ¼r die Weltraum-Putze.\r\n',0,0,'instabil nicht_kaperbar sehr_klein',10,0,0,451,0,0,0.75,'',1,0,'',0,'Weltraumschrott',4,199,'data/dynamicContent/b19f302a-1fad-4c06-a7c7-8958c02b988d.png',0,0,0,0,0,99,0,0,14,20,1,0,0,2,0,'',0,NULL),(51,0,75000,0.00,45000,0,5,2000,'Der Standardträger von Vasudanern und Terranern gleichermaßen. Er ist eines der wenigen Schiffe, daß Jäger und Bomber zu ihren Zielen transportieren kann, wo diese dann ihren Auftrag durchführen. Und sollten die 28 transportierten Jäger bzw. Bomber nicht ausreichen, so vermag die Kottos, deren Offensivarsenal zwar unter Korvettenniveau liegt, die jedoch durchaus in der Lage ist feindliche Schiffe anzugreifen und dabei dank einer maßiven Hüllenstärke, die nur von Zerstörern übertroffen wird, auch feindliches Feuer einzustecken, ihnen dabei durchaus zu helfen - auch wenn der mögliche Verlust eines solchen Schiffes einen zweimal über deßen einsatz nachdenken laßen sollten, verliert man bei der Zerstörung doch nicht nur 5500 Mann Crew und ein aufwändig produziertes Schiff, sondern auch die Möglichkeit weitere Staffeln ins Kampfgebiet zu tragen.\r\n[Model: Rhonabwy]',0,400,'secondrow',10,4,0,100000,0,40,0.75,'TerSlash=10|heavy_flak=10|standard_flak=15|AAAf=40|raketen=40',10,1200,'1:misc_kottos;2:misc_kottos;3:armour;4:armour;5:armour;6:armour;7:armour;8:armour;9:armour;10:armour;11:armour;12:armour',29400,'GTCa Kottos',10,2,'data/dynamicContent/334914d7-0898-4d10-b9c6-7cd3333c025b.png',0,8,15,135,0,1,4,0,15,11,1,0,1000,16,0,'TerSlash=2|heavy_flak=2|standard_flak=3|AAAf=5|raketen=4',0,NULL),(53,0,0,0.00,3200,0,4,2,'Der Torpedobomber der Samurai-Klasse ist eines der neueren Schiffe. Er wurde in den letzten Kriegstagen getestet und richtete verheerende SchÃ¤den an shivanischen GroÃŸkampfschiffen aus. Wie bei allen Bombern ist eine JÃ¤gereskorte dringend zu empfehlen.\r\nBesonderes Augenmerk hatten die Entwickler auf einen extrem leistungsfÃ¤higen Reaktor gelegt -  in Hinblick auf eine Anwendung der Schirmtechnologie fÃ¼r Jagdbomber.\r\n[Model: Dunkelwolf/guzman]',0,70,'jaeger abfangen',10,7,0,280,0,0,0.75,'Prometheus=16|raketen=8|torpedos=5',1,2,'1:jprimary:Prometheus;2:jprimary:Prometheus;3:jprimary:Prometheus;4:jprimary:Prometheus',250,'Ronin',0,2,'data/dynamicContent/dd9a5702-d092-407c-b2e9-3ee842168edd.png',20,10,2,40,0,1,1,700,17,2,1,2,0,14,0,'Prometheus=4|raketen=2|torpedos=1',0,NULL),(54,0,0,0.00,700,0,4,2,'Der GTB Zeus ist einer der schnellsten im Einsatz befindlichen GCP-Bomber. Er ersetzt die alten Athena-Bomber der GTA die bereits kurz nach dem Großen Krieg au&szliger Dienst gestellt worden waren. Auch wenn er geringfügig langsamer ist als die alte Athena, so erreicht der Zeus durch seine bessere Bewaffung sowie Panzerung eine wesentlich höhere Überlebensrate in Kampfeinsätzen. Während der NTF-Rebelion desertierten viele der Zeus-Staffeln und liefen zur NTF über.',0,70,'jaeger abfangen',10,10,0,550,0,0,0.75,'Subach_HL-7=6|Prometheus=6|raketen=1|torpedos=5',1,2,'1:jprimary:Subach_HL-7;2:jprimary:Subach_HL-7;3:jprimary:Prometheus;4:jprimary:Prometheus',250,'GTB Zeus',2,2,'data/dynamicContent/5cce875e-0933-4204-b685-3740d2a0a166.png',10,7,1,25,0,1,1,560,17,2,1,0,0,11,0,'Subach_HL-7=2|Prometheus=2|raketen=1|torpedos=1',0,NULL),(55,0,0,0.00,800,0,4,1,'Stolz präsentiert ihnen die GTU das Ergebnis eines Joint Ventures zwischen Triton Dynamics, der Akheton Corp, der zweiten Flotte der GCP und namhafter Wissenschafftler der Lost Lands. Die Batis ist als überschwerer Jäger klassifiziert und trägt große Mengen an Raketen.\r\n[Bild: Sicus]',0,110,'jaeger abfangen',10,10,0,200,0,0,0.75,'Prometheus=24|raketen=12',1,1,'1:jprimary:Prometheus;2:jprimary:Prometheus;3:jprimary:Prometheus;4:jprimary:Prometheus;5:jprimary:Prometheus;6:jprimary:Prometheus',210,'GTF Batis',1,2,'data/dynamicContent/6fb9b66d-3c2e-4a50-8471-69b01d14960d.png',0,10,2,30,5,1,1,550,9,2,1,6,0,12,0,'Prometheus=6|raketen=4',0,NULL),(56,0,0,0.00,600,0,4,1,'\"Die Fledermaus\", wie Ihre Piloten sie nennen, ist der erste jemals von Vasudanern und Terranern gemeinsam entwickelte Jäger, der bereits seit dem Großen Krieg eingesetzt wird und auch heute noch genutzt wird. Überragende Manövrierfähigkeit und eine gute Höchstgeschwindigkeit wurden bei der Entwicklung höher geschätzt als Panzerung und Munitionsfassungsvermögen, was die Ulysses zu einem Jäger macht, der besser in Angriffs- als in Defensivoperationen genutzt werden sollte.',0,60,'jaeger abfangen',10,8,0,180,0,0,0.75,'Subach_HL-7=16|raketen=8',1,1,'1:jprimary:Subach_HL-7;2:jprimary:Subach_HL-7;3:jprimary:Subach_HL-7;4:jprimary:Subach_HL-7',210,'GTF Ulysses',0,2,'data/dynamicContent/cf8a0a30-e3d1-4c49-b820-90da17094d73.png',0,10,2,20,0,1,0,360,9,1,1,8,0,15,0,'Subach_HL-7=4|raketen=2',0,NULL),(57,0,0,0.00,600,0,4,1,'Als einer der neuesten Jäger des GCP und Nachfolger des berühmten Valkyriejägers steht dieser Abfangjäger in einer reihe mit seinem Vorfahren, dessen Qualitäten er ebenso teilt wie dessen Nachteile. Eine erschreckend hohe Höchstgeschwindigkeit und Manövrierfähigkeit, durchschnittliche Schild- und Hüllenwerte, unterdurchschnittliche Primär- und mittelmäßige Sekundärwaffen zeichnen den Perseus aus. Modernste Triebwerke ermöglichen einen schnellen Schlachtbeitritt und exzellente Ergebnisse beim Abfangen von Heliostorpedos, so daß der Siegeszug dieses Jägers kaum zu stoppen sein wird.',0,60,'jaeger abfangen instant_battle_enter',10,8,0,265,0,0,0.75,'Subach_HL-7=6|raketen=8',1,1,'1:jprimary:Subach_HL-7;2:jprimary:Subach_HL-7',210,'GTF Perseus',0,2,'data/dynamicContent/947029e5-694c-4e84-8bf2-a1adaac9d818.png',12,8,2,24,0,1,1,300,9,2,1,10,0,12,0,'Subach_HL-7=2|raketen=2',0,NULL),(58,0,30000,0.00,5500,0,3,400,'Die GTC Aeolus ist der erste Kreuzer der je von RNI gebaut wurde. Nur Zwei-Dutzend dieser Kreuzer wurden ihn den Dienst der GTVA gestellt. Die Produktion wurde 2365 eingestellt. Das Haupteinsatzgebiet der GTC Aeolus ist das bewachen von Konvois gegen Jäger und Bomber. Aufgrund der steigenden Nachfrage nach Eskortschiffen wurde die Produktion der Aeolus  wieder aufgenommen, wenn auch mit Änderungen an der Ausstattung um die hohen Produktions- und Wartungskosten zu senken.',0,250,'',10,4,0,30000,0,0,0.75,'SGreen=10|Terran_Turret=60|standard_flak=90|AAAf=15',5,240,'1:misc;2:misc;3:terran_hcruiser_upgrade;5:armour;6:armour;7:armour;8:armour;9:armour',4900,'GTC Aeolus',7,2,'data/dynamicContent/2f0c62d6-cad2-4c55-b2bf-a312d98334ad.png',0,8,5,80,4,1,3,0,7,8,1,8,100,14,0,'SGreen=2|Terran_Turret=6|standard_flak=6|AAAf=3',0,NULL),(61,0,0,0.00,2000,0,0,0,'Das Knossosportal - eine gigantische Einrichtung zum Stabilisieren von Sprungpunkten. Die Einrichtung wurde von den Uralten entwickelt. Die GTVA und später die GCP entdeckten eine Reihe an Knossosportalen, jedoch gelang es ihnen bisher nicht diese kontrollieren.',0,1000,'zerstoererpanzerung',10,0,0,1000000,0,0,0.75,'',1,0,'',0,'Knossosportal',255,2,'data/schiffe/ancient/art_knossos.png',20,0,0,60,0,1,0,0,19,60,1,0,0,2,0,'',0,NULL),(64,0,0,0.00,1000,0,0,0,'Die GTSG Alastor ist mit zwei Bessmer-Kohn Geschützen ausgestattet. Das Geschütz selbst wird von einem Neuralen Netz neuester Art gesteuert, das es dem Geschütz ermöglicht mehrere Ziele gleichzeitig zu verfolgen.',0,100,'',5,0,0,250,0,0,0.75,'Prometheus=10|raketen=12',1,0,'1:jprimary:Prometheus;2:jprimary:Prometheus',0,'GTSG Alastor',2,2,'data/dynamicContent/25f10b53-ac90-4d50-b0df-6ecf0d1b4810.png',0,10,1,25,5,1,0,0,10,1,1,0,0,7,0,'Prometheus=2|raketen=2',0,NULL),(67,0,0,0.00,750,0,8,3,'Die GVB Osiris war der Primäre Bomber der PVN während des großen Krieges. Sie zeigte ihr Alter während des zweiten shivanischen Krieges, da die fortschrittlicheren Bakha und Sekhmet Bomber sie in den meisten Bombergeschwadern ersetzt hatten. \r\nOsiris Bomber, die sich noch im Dienst befinden, sind nachgerüstet worden, um sie mit den meisten der Flugkörper und Bomben kompatibel zu machen - sie stellt in den Lost Lands das vasudanische Pendant zur TB Samurai dar. \r\nWenn sie durch Jägereskorten geschützt wird, kann eine Rotte Osiris Bomber große Verwüstung an feindlichen Kreuzern und Korvetten verursachen.',0,80,'jaeger abfangen',10,10,0,600,0,0,0.75,'Prometheus=8|raketen=4|torpedos=5',1,3,'1:jprimary:Prometheus;2:jprimary:Prometheus',250,'GVB Osiris',0,2,'data/dynamicContent/5180665b-40b9-4ae7-8316-f4137c0825fe.png',6,4,1,24,0,1,1,600,17,2,1,0,0,10,0,'Prometheus=2|raketen=2|torpedos=1',0,NULL),(69,0,0,0.00,500,0,4,1,'Der Standardjäger der HoL - zu seiner Glanzzeit einer der wendigsten Jäger überhaupt',0,60,'jaeger abfangen instant_battle_enter',10,5,0,200,0,0,0.75,'Mekhu_HL-7=24|raketen=12',1,1,'1:jprimary:Prometheus;2:jprimary:Prometheus;3:jprimary:Prometheus;4:jprimary:Prometheus',210,'HLF Toth',0,2,'data/dynamicContent/2ea801e5-86e6-472d-bed1-15e4f382ccfe.png',0,8,2,24,4,1,0,300,9,1,1,10,0,15,0,'Mekhu_HL-7=4|raketen=2',0,NULL),(71,0,0,0.00,600,0,1,1,'Im Einsatz seit der Zerstörung der GTD Goliath im Jahre 2323, stellen diese Kapseln die Standardausrüstung von jedem terranischen Schiff der Kreuzerklasse und höher. Per Magnetkupplung an die Außenhülle geheftet können diese im Notfall schnell abgedockt werden um ihre Insassen in Sicherheit zu bringen.',0,40,'jaeger',10,12,0,200,0,0,0.75,'',1,0,'',210,'GTEP Hermes',0,2,'data/dynamicContent/2d94f88c-1ad3-418b-83fa-c7be6810c0c9.png',0,0,0,0,0,1,0,0,18,1,1,0,0,5,0,'',0,NULL),(74,0,0,0.00,180000,0,2,600,'Die Terraner entwickleten die Hippokrates nach dem Großen Krieg. Die medizinischen Einrichtungen ermöglichen die Erstversorgung und Stabilisierung tausender Patienten, die dann von der Hippokrates selbst oder von anderen Transportern in den rückwärtigen Raum evakuiert werden können. Bei der Evakuierung Capellas erwiesen sich die Hippokrateschiffe ebenfalls als unverzichtbare Hilfe, entlasteten sie die kleineren Argo- und Elysiumtransporter doch ungemein.',0,320,'srs_awac secondrow',10,6,0,50000,0,10,0.75,'